import './App.css';
import {Route, Routes} from "react-router-dom";
import Hotel from "./hotel/Hotel";

function App() {
  return (
    <Routes>
        <Route path={"/reply/"} element={<Hotel/>}/>
    </Routes>
  );
}

export default App;
